import React, {Component} from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {

  constructor() {
    super();

    this.state = {
      monsters: [
        {
          name: "Frankenstein",
          surname: "Ololo"
        },
        {
          name: "Dracula",
          surname: "Ololo"
        },        
        {
          name: "Zombie",
          surname: "Ololo"
        },
        {
          name: "Your mom",
          surname: "Ololo"
        },
      ]
    }
  }

  render(){
    return (
      <div className="App">
        {
         this.state.monsters.map( monster => <h1> {monster.name+ " " + monster.surname} </h1>)
        }
      </div>
    );
  }
}

export default App;
